const e=JSON.parse('{"key":"v-0a660adc","path":"/note/golang/gorm/01.3.html","title":"Associations","lang":"zh-CN","frontmatter":{"title":"Associations","date":"2021-11-29T00:00:00.000Z","category":["golang"],"tag":["gorm"],"timeline":true},"headers":[{"level":2,"title":"7. Associations","slug":"_7-associations","link":"#_7-associations","children":[{"level":3,"title":"7.1 Belongs To","slug":"_7-1-belongs-to","link":"#_7-1-belongs-to","children":[]},{"level":3,"title":"7.2 Has One","slug":"_7-2-has-one","link":"#_7-2-has-one","children":[]},{"level":3,"title":"7.3 Has Many","slug":"_7-3-has-many","link":"#_7-3-has-many","children":[]},{"level":3,"title":"7.4 Many To Many","slug":"_7-4-many-to-many","link":"#_7-4-many-to-many","children":[]},{"level":3,"title":"7.5 Association Mode","slug":"_7-5-association-mode","link":"#_7-5-association-mode","children":[]},{"level":3,"title":"7.6 Preloading(Eager Loading)","slug":"_7-6-preloading-eager-loading","link":"#_7-6-preloading-eager-loading","children":[]}]},{"level":2,"title":"Reference","slug":"reference","link":"#reference","children":[]}],"git":{"updatedTime":1682668422000},"readingTime":{"minutes":14.09,"words":4227},"filePathRelative":"note/golang/gorm/01.3.md","localizedDate":"2021年11月29日","excerpt":"<h2> 7. Associations</h2>\\n<h3> 7.1 Belongs To</h3>\\n<p>A  <code>Belongs To</code> association sets up a one-to-one connection with another model, such that each instance of  the declaring model \\"belongs to\\" one instance of the other model</p>\\n<p>For example, if your application includes users and companies, and each user can be assigned to exactly one company, the following types represent that relationship. Notice here that, on the <code>User</code> object, there is both a <code>CompanyID</code> as well as a <code>Company</code>. By default, the <code>CompanyID</code>  is implicity usesd to create a foreign key relationship between the <code>User</code> and <code>Company</code> tables, and thus must be included in the <code>User</code> struct in order to fill the <code>Company</code> inner strcut</p>"}');export{e as data};
